class Solution:
    def wallRotate(self, matrix: List[List[int]]) -> List[List[int]]:

        self.dic = {}

        def dfs(r, c):

            if r == len(matrix):
                return

            if c == len(matrix[r]):
                return

            if c not in self.dic:
                self.dic[c] = matrix[r][c]

            dfs(r + 1, c)

            self.dic[c] = matrix[r][c]

            dfs(r + 1, c + 1)

        dfs(0, 0)
        return self.dic

