class Solution:
    def maxDistance(self, grid: List[List[int]]) -> int:
        if not grid:
            return 0

        m, n = len(grid), len(grid[0])
        if m == 1 and n == 1:
            return grid[0][0]

        m2 = m // 2
        n2 = n // 2
        for i in range(m2):
            for j in range(n2):
                self.dfs(grid, i, j, 0)

        for i in range(m2):
            for j in range(n2):
                self.dfs(grid, i, j, 1)

        for i in range(m2):
            for j in range(n2):
                self.dfs(grid, i, j, 2)

        return max(grid[m2-1][n2-1], grid[m2-1][n2])

    def dfs(self, grid, i, j, d):
        if not 0 <= i < len(grid) or not 0 <= j < len(grid[0]) or grid[i][j]!= -1:
            return

        grid[i][j] = -1

        neighbors = [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]
        for x, y in neighbors:
            if not 0 <= x < len(grid) or not 0 <= y < len(grid[0]) or grid[x][y] == -1:
                continue
            if grid[x][y] == 1:
                if d == 1:
                    self.dfs(grid, x, y, 0)
                else:
                    self.dfs(grid, x, y, 1)
                grid[x][y] = -1
        if d == 2:
            self.dfs(grid, i, j, 0)
        else:
            self.dfs(grid, i, j, 2)

