    def binary_search(n,l,r):
        while l <= r:
            mid = (l+r)//2
            if n == 0:
                return mid
            if n >= 0:
                if n >= l and n >= mid:
                    return mid
                if n <= mid and n <= r:
                    return mid
                if n < mid and n <= l:
                    return mid
                if n > mid and n < r:
