        mid = binary_search(n,l,r)
        if mid == l:
            return (n,1)
        elif mid == r:
            return (n,0)
        else:
            return (n,1)
    def permutations(n,l,r):
        if l == r:
            return [[n]]
        mid = binary_search(n,l,r)
        if mid == l:
            return [[]]
        elif mid == r:
            return []
        else:
            p = permutations(n,l,mid-1)
            q = permutations(n,mid+1,r)
            return p + q
    def sum(n,l,r):
        if l == r:
            return n
        mid = binary_search(n,l,r)
        if mid == l:
            return sum(n,l,r)
        elif mid == r:
            return sum(n,l,mid-1)
        else:
            return sum(n,mid+1,r)
    def sum_rec(n,l,r):
        if l == r:
            return n
        mid = binary_search(n,l,r)
        if mid == l:
            return sum_rec(n,l,mid-1)
        elif mid == r:
            return sum_rec(n,mid+1,r)
        else:
            return sum_rec(n,mid+1,mid-1) + sum_rec(n,mid+1,mid-1)
    def generate_rec(n,l,r):
        if l == r:
            return (n,1)
        mid = binary_search(n,l,r)
        if mid == l:
            return generate_rec(n,l,mid-1)
        elif mid == r:
