def solution(stdin: str) -> str:
    # using a stack
    # if the total height of height is less than n, it means that you have moved to a new square
    # by checking if the stack and the height of stack are the same
    # if the stack is empty, then the heights are the same
    # and the heights can be moved, which is smaller than n
    # then, its possible the new height is bigger than the old one, the height is greater than n
    # and the height is smaller than n
    n = int(stdin.strip())
    if n < 10**9: return str(n)
    stack = []
    height = []
    for i in range(n):
        height.append(int(stdin.strip()[i]))
        if not stack or height[-1] < stack[-1]:
            stack.append(height[-1])
        else:
            stack.pop()
            height[-1] = height[-1] * 2
    return str(max(stack))

