class Solution:
    def numberOfWays(self, n: int, a: List[int], b: List[int]) -> int:
        # Recursive
        if n <= 1:
            return n * sum(a) + sum(b)
        else:
            if a[0] > b[0]:
                return self.numberOfWays(n - 1, a[1:], b[1:])
            elif b[0] > a[0]:
                return self.numberOfWays(n - 1, a[1:], b[1:])
            else:
                return self.numberOfWays(n - 1, a[1:], b[1:]) + self.numberOfWays(n - 1, a, b[1:])


