def solution(stdin: str) -> str:
    """
    Solution to DFA(DNA-alphabet) problem
    """
    # 
    def rec(s:str, k:int) -> str:
        """
        returns the next substring of s that is a substring of s[:k]
        """
        # for each character of s
        for i in range(len(s) - k):
            # if we are on the end of the substring
            if s[i:i + k] == s[i:i + k][::-1]:
                # update current substring
                s = s[:i] + s[i + k:]
        return s

    def isSubstring(s:str, substring:str) -> bool:
        """
        checks if a substring of s is a substring of s[i:i + len(substring)]
        """
        if len(substring) <= 0:
            return True
        for i in range(len(s) - len(substring) + 1):
            if s[i:i + len(substring)] == substring:
                return True
        return False

    def F(i:int, k:int) -> bool:
        """
        Checks if s[i:i + k] is a substring of s[i:i + k]
        """
        for i in range(i, i + k):
            if i >= len(s) or not s[i]:
                return False
        return True

    def DFS(s:str, k:int) -> bool:
        """
        checks if s[i:i + k] is a substring of s[i:i + k]
        """
        if len(s) <= 0:
            return False
        if len(s) == 1:
            return F(s[0], k)
        if F(s[0], k):
            return DFS(s[1:], k)
        if F(s[0], k):
            return DFS(s[1:], k)
        return True

    return max(map(len, filter(lambda s: s, map(rec, stdin, range(int(len(stdin) / 2))))))

