    cnt = 0
    for i in range(1, n):
        # If we have one company, all the roads are good
        if sum(i in j for j in range(1, n)) == 1:
            cnt += 1

    # If we do not have any company, all the roads are not good
    if cnt == n:
        return n-1

    # Second, find the number of good roads
    for i in range(1, n):
        for j in range(0, n - 1):
            if roads[j][i] == 1:
                # Remove the two neighbors and find the number of the rest of the good roads
                if j == 0 or roads[j - 1][i - 1] == 1:
                    roads[j][i] = 0
                elif roads[j - 1][i - 1] == 0:
                    roads[j][i] = 0
                else:
                    roads[j][i] -= 1

        # Remove the two neighbors and find the number of the rest of the good roads
        if j == n - 1 or roads[j + 1][i] == 1:
            roads[j][i] = 0
        elif roads[j + 1][i] == 0:
            roads[j][i] = 0
        else:
            roads[j][i] -= 1

    return cnt


