    # find the last to the last gem, if more than one then use the first two
    last_gem_idx = n - 1
    for i in range(2, n + 1):
        last_gem_idx = i - 1
        if second_two_gems[i] > first_two_gems[last_gem_idx]:
            second_two_gems[i] = first_two_gems[last_gem_idx] + gems[i]

    # choose the second gem with the lowest value
    second_gem_idx = 0
    min_val = float("inf")
    for idx, val in enumerate(second_two_gems):
        if val < min_val and idx >= second_gem_idx:
